import React, { Component } from 'react'
import PropTypes from 'prop-types'
import { Link } from 'react-router'

import Paginator from 'shared/paginator'
import BranchesStore from 'stores/branches'
import EditClientActions from 'actions/editClient'
import TextField from 'shared/textField'
import TableFilter from 'shared/tableFilter'
import IconButton from 'shared/iconButton'
import accounting from 'accounting'

function getCurrentState () {
  const branches = BranchesStore.getBranchesList()
  const totalPages = BranchesStore.getTotalPages()
  const totalItems = BranchesStore.getTotalItems()
  return {
    branches,
    totalItems,
    totalPages
  }
}

class BranchesTable extends Component {
  constructor () {
    super()
    this.data = {
      filters: {
        description: ''
      }
    }
    this.state = Object.assign({}, this.data, getCurrentState())
    this._onChange = this._onChange.bind(this)
  }

  componentDidMount () {
    // Adds listener, when the Store changes, trigger the _onChange callback func
    BranchesStore.addChangeListener(this._onChange)
    this.loadData()
  }

  componentDidUpdate (prevProps) {
    if (this.props.location.search !== prevProps.location.search) {
      this.loadData(this.props)
    }
  }

  componentWillUnmount () {
    // Removes the listener to avoid memory leaks
    BranchesStore.removeChangeListener(this._onChange)
  }

  _onChange () {
    // When the store changes, the state goes to it and pulls the updated data
    // then sets it so the component rerenders
    const state = getCurrentState()
    this.setState(state)
  }

  loadData (props = this.props) {
    const params = Object.assign({}, props.location.query)
    EditClientActions.getBranchesList(params)
    this.setState(prevState => ({
      filters: Object.assign({}, prevState.filters, params)
    }))
  }

  onChangeFilter (field, e) {
    const filter = { [field]: e.target.value }
    this.setState(prevState => ({
      filters: Object.assign({}, prevState.filters, filter)
    }))
  }

  // Reset all filters and data to default
  clearFilters () {
    this.setState({ filters: this.data.filters })
  }

  // Render a wrapper for the filters element
  renderFilters () {
    const { filters } = this.state
    return (
      <TableFilter
        baseUrl='/sucursales'
        filters={filters}
        onClearFilters={this.clearFilters.bind(this)}
      >
        <TextField
          placeholder='Nombre'
          value={this.state.filters.description}
          onChange={this.onChangeFilter.bind(this, 'description')}
        />
      </TableFilter>
    )
  }

  // Renders each employee and adds them as a row in the table
  renderTableBody () {
    let rows = this.state.branches.map((branch, index) => {
      const postalCode = branch.postal_code ? `C.P. ${branch.postal_code}` : ''
      return (
        <tr key={index}>
          <td className='align-left'>{branch.name}</td>
          <td className='align-left'>{postalCode}</td>
          <td>
            <Link to={`/sucursal/${branch.id}`}>
              <IconButton icon='pencil' tooltip='Editar' />
            </Link>
          </td>
        </tr>
      )
    })

    return <tbody>{rows}</tbody>
  }

  renderTable () {
    let table = (
      <div className='content'>
        <div className='block unselectable'>
          <p>No hay sucursales</p>
        </div>
      </div>
    )
    if (this.state.branches.length > 0) {
      table = (
        <div>
          <table className='table'>
            <thead>
              <tr>
                <th className='align-left'>Nombre</th>
                <th className='align-left'>CÃ³digo Postal</th>
                <th />
              </tr>
            </thead>
            {this.renderTableBody()}
          </table>
          <Paginator
            totalPages={this.state.totalPages}
            location={this.props.location}
          />
        </div>
      )
    }
    return table
  }

  render () {
    return (
      <div>
        {this.renderFilters()}
        <div className='caption'>
          {accounting.formatNumber(this.state.totalItems)} elementos visibles
        </div>
        <br />
        {this.renderTable()}
      </div>
    )
  }
}

BranchesTable.propTypes = {
  location: PropTypes.object
}
export default BranchesTable
